import React from "react";

import './Contact.css';

const Contact = () => {
  return (
    <React.Fragment>
     <div class="contact__us">
    <div>
      <h1>Contact Us</h1>
    </div>

    <div class="details">
      <h2>Address</h2>
      <p>3811 Sherwood Circle</p>
      <p>Kernersville</p>
      <p>North Carolina</p>
      <h2>Phone</h2>
      <p>+91 9123456789</p>
      <h2>Email</h2>
      <p>test@email.com</p>
    </div>
  </div>
    </React.Fragment>
  );
}

export default Contact;
